//
// these easing functions are based on the code of glsl-easing module.
// https://github.com/glslify/glsl-easings
//

const ease = {
  exponentialIn: (t) => {
    return t == 0.0 ? t : Math.pow(2.0, 10.0 * (t - 1.0));
  },
  exponentialOut: (t) => {
    return t == 1.0 ? t : 1.0 - Math.pow(2.0, -10.0 * t);
  },
  exponentialInOut: (t) => {
    return t == 0.0 || t == 1.0
      ? t
      : t < 0.5
        ? +0.5 * Math.pow(2.0, (20.0 * t) - 10.0)
        : -0.5 * Math.pow(2.0, 10.0 - (t * 20.0)) + 1.0;
  },
  sineOut: (t) => {
    const HALF_PI = 1.5707963267948966;
    return Math.sin(t * HALF_PI);
  },
  circularInOut: (t) => {
    return t < 0.5
        ? 0.5 * (1.0 - Math.sqrt(1.0 - 4.0 * t * t))
        : 0.5 * (Math.sqrt((3.0 - 2.0 * t) * (2.0 * t - 1.0)) + 1.0);
  },
  cubicIn: (t) => {
    return t * t * t;
  },
  cubicOut: (t) => {
    const f = t - 1.0;
    return f * f * f + 1.0;
  },
  cubicInOut: (t) => {
    return t < 0.5
      ? 4.0 * t * t * t
      : 0.5 * Math.pow(2.0 * t - 2.0, 3.0) + 1.0;
  },
  quadraticOut: (t) => {
    return -t * (t - 2.0);
  },
  quarticOut: (t) => {
    return Math.pow(t - 1.0, 3.0) * (1.0 - t) + 1.0;
  },
}

class ShapeOverlays {
  constructor(elm) {
    this.elm = elm;
    this.path = elm.querySelectorAll('path');
    this.numPoints = 8;
    this.duration = 900;
    this.delayPointsArray = [];
    this.delayPointsMax = 250;
    this.delayPerPath = 220;
    this.timeStart = Date.now();
    this.isOpened = false;
    this.isAnimating = false;
  }
  toggle() {
    this.isAnimating = true;
    for (var i = 0; i < this.numPoints; i++) {
      this.delayPointsArray[i] = Math.random() * this.delayPointsMax;
    }
    if (this.isOpened === false) {
      this.open();
    } else {
      this.close();
    }
  }
  open() {
    this.isOpened = true;
    this.elm.classList.add('is-opened');
    this.timeStart = Date.now();
    this.renderLoop();
  }
  close() {
    this.isOpened = false;
    this.elm.classList.remove('is-opened');
    this.timeStart = Date.now();
    this.renderLoop();
  }
  updatePath(time) {
    const points = [];
    for (var i = 0; i < this.numPoints; i++) {
      points[i] = (1 - ease.cubicInOut(Math.min(Math.max(time - this.delayPointsArray[i], 0) / this.duration, 1))) * 100
    }

    let str = '';
    str += (this.isOpened) ? `M 0 0 V ${points[0]}` : `M 0 ${points[0]}`;
    for (var i = 0; i < this.numPoints - 1; i++) {
      const p = (i + 1) / (this.numPoints - 1) * 100;
      const cp = p - (1 / (this.numPoints - 1) * 100) / 2;
      str += `C ${cp} ${points[i]} ${cp} ${points[i + 1]} ${p} ${points[i + 1]} `;
    }
    str += (this.isOpened) ? `V 100 H 0` : `V 0 H 0`;
    return str;
  }
  render() {
    if (this.isOpened) {
      for (var i = 0; i < this.path.length; i++) {
        this.path[i].setAttribute('d', this.updatePath(Date.now() - (this.timeStart + this.delayPerPath * i)));
      }
    } else {
      for (var i = 0; i < this.path.length; i++) {
        this.path[i].setAttribute('d', this.updatePath(Date.now() - (this.timeStart + this.delayPerPath * (this.path.length - i - 1))));
      }
    }
  }
  renderLoop() {
    this.render();
    if (Date.now() - this.timeStart < this.duration + this.delayPerPath * (this.path.length - 1) + this.delayPointsMax) {
      requestAnimationFrame(() => {
        this.renderLoop();
      });
    }
    else {
      this.isAnimating = false;
    }
  }
}
(function() {
  const elmHamburger = document.querySelector('#icon-hamburger');
  const gNavItems = document.querySelectorAll('.global-menu__item');
  const elmOverlay = document.querySelector('.shape-overlays');
  const overlay = new ShapeOverlays(elmOverlay);

  elmHamburger.addEventListener('click', () => {
    if (overlay.isAnimating) {
      return false;
    }
    overlay.toggle();
    if (overlay.isOpened === true) {
      elmHamburger.classList.add('is-opened-navi');
      for (var i = 0; i < gNavItems.length; i++) {
        gNavItems[i].classList.add('is-opened');
      }
    } else {
      elmHamburger.classList.remove('is-opened-navi');
      for (var i = 0; i < gNavItems.length; i++) {
        gNavItems[i].classList.remove('is-opened');
      }
    }
  });
}());

(function() {
  var follower, init, mouseX, mouseY, positionElement, printout, timer;

  follower = document.getElementById('follower');

  printout = document.getElementById('printout');

  mouseX = (event) => {
    return event.clientX;
  };

  mouseY = (event) => {
    return event.clientY + window.scrollY;
  };

  positionElement = (event) => {
    var mouse;
    mouse = {
      x: mouseX(event),
      y: mouseY(event)
    };

    if(!follower.classList.contains('sticky')){
        follower.style.left = mouse.x + 'px';
        follower.style.top = mouse.y + 'px';
    }

//    return follower.style.left = mouse.x + 'px';
  };

  timer = false;

  window.onmousemove = init = (event) => {
    var _event;
    _event = event;
    return timer = setTimeout(() => {
      return positionElement(_event);
    });
  };

  window.onclick = init = (event) => {
    var _event;
    _event = event;
    return timer = setTimeout(() => {
      return positionElement(_event);
    });
  };

 window.onscroll = init = (event) => {
    var event = new MouseEvent('click', {});

    document.body.dispatchEvent(event);
  };
}).call(this);

/**
 * envoie des formulaires en AJAX
 */
(function(){

    var form = document.querySelector('[action="xhr/sendmail.php"]');

    if(form){

        form.addEventListener('submit', function(evt){

            form.classList.add('sending');
            var div = document.querySelector('.form-services');

            if(div){
                div.classList.add('sending');
            }

            evt.preventDefault();

            var datas = new FormData(this);

            /*  insertion dans l'obj Formdata des 'item' des listes design, web, marketing */
            ['design', 'web', 'marketing'].forEach(function(list){
                Array.from(document.querySelectorAll('#list-' + list + ' > li > .active')).forEach(function(item){
                    datas.append(list + '[]', item.innerHTML);
                });
            });

            var xhr = new XMLHttpRequest();

            xhr.addEventListener('load', function(){

                form.classList.remove('sending');
                if(div){
                    div.classList.remove('sending');
                }

                var ans = JSON.parse(xhr.responseText);

                console.log('ajax', ans);

                if(ans.err){

                    /* nettoyer le formulaire des erreurs prÃ©cÃ©dentes */
                    Array.from(document.getElementsByClassName('error')).forEach(span => {
                        span.classList.remove('error');
                        span.querySelector('.msg-system').innerHTML = '';
                    });

                    /* le formulaire n'est pas valide */
                    for(let input in ans.err){
                        let span = document.getElementById('form-' + input);
                        span.classList.add('error');
                        span.querySelector('.msg-system').innerHTML = ans.err[input];
                    }
                    console.log('erreur(s) validation', ans.err);

                } else {

                    if(ans.email){

                        /* l'email a bien Ã©tÃ© envoyÃ© */
                        form.reset()

                        /* fermer le formulaire + reset le contenu */
                        $('.form-bottom, .navbar-bottom').removeClass('enlarge');
                        $('.icon-close, .navbar-bottom .services li a.active').hide();
                        $('a.show-form, a.show-services').show();
                        $('.services li a.active').removeClass('active');
                        $('span.count').html('0');
                        $('.list-design_section, .list-web_section, .list-marketing_section, #form-home').hide();

                        Array.from(document.getElementsByClassName('error')).forEach(span => {
                            span.classList.remove('error');
                            span.querySelector('.msg-system').innerHTML = '';
                        });

                        var popupSuccess = document.getElementsByClassName('popup-success')[0];
                        
                        /* ouverture du popup */
                        popupSuccess.classList.add('show');
                        
                        /* fermeture automatique du popup */
                        setTimeout(function(){
                            popupSuccess.classList.remove('show');
                        }, 8000);

                        function myFunction() {
                            var element = document.getElementsByClassName('popup-success');
                            element.classList.add('show');
                        }

                    } else {

                        /* il y a eu un problÃ¨me avec l'envoie du mail */

                        console.log('Erreur lors de l\'envoi du mail, veuillez rÃ©essayer plus tard.');
                        function myFunction() {
                            var element = document.getElementsByClassName('popup-error');
                            element.classList.add('show');
                        }
                    }

                }

            });

            xhr.addEventListener('error', function(){

                form.classList.remove('sending');
                document.getElementsByClassName('form-services')[0].classList.remove('sending');
                
                /* erreur AJAX */

                var popupError = document.getElementsByClassName('popup-error')[0];
                        
                /* ouverture du popup */
                popupError.classList.add('show');
                
                /* fermeture automatique du popup */
                setTimeout(function(){
                    popupError.classList.remove('show');
                }, 5000);

            });

            xhr.open('post', form.action);
            xhr.send(datas);

        });
    }

})();
